import React from 'react';
import {Card, Col, Image} from "react-bootstrap";

const PhotoItem = ({photo}) => {
    console.log(photo);
    return (
        <Col md={4} >
            <Card style={{marginTop: 15}}>
                <Image style="100%" src={process.env.REACT_APP_API_URL + photo.img}/>
            </Card>
        </Col>
    );
};

export default PhotoItem;
